import React from "react";
import { ScrollView, Text, View, Image, StyleSheet } from "react-native";

const Class = () => {
    return (
        <Text>
            Esta es la pagina de los modulos
        </Text>
    );
}

const styles = StyleSheet.create({
    title: {
        fontSize: 20,
        marginTop: 50
    }
});

export default Class
